/* ====== Data ====== */
const products = [
  { id: 1, name: "Rasgulla", price: 120, img: "data:image/jpeg;base64," },
  { id: 2, name: "Gulab jamun", price: 100, img: "data:image/jpeg;base64," },
  { id: 3, name: "Kaju Katli", price: 450, img: "data:image/jpeg;base64," },
  { id: 4, name: "Motichoor Laddu", price: 180, img: "data:image/jpeg;base64," },
  { id: 5, name: "Barfi Mix", price: 300, img: "data:image/jpeg;base64," },
  { id: 6, name: "Jalebi", price: 120, img: "data:image/jpeg;base64," },
  { id: 7, name: "Samosa (1 pc)", price: 15, img: "data:image/jpeg;base64," },
  { id: 8, name: "Paneer Puff", price: 35, img: "data:image/jpeg;base64," },
  { id: 9, name: "Kachori", price: 20, img: "data:image/jpeg;base64," },
  { id: 10, name: "Chocolate Cake (1/2kg)", price: 350, img: "data:image/jpeg;base64," },
  { id: 11, name: "Black Forest Cake (1/2kg)", price: 400, img: "data:image/jpeg;base64," },
  { id: 12, name: "Veg Patties", price: 30, img: "data:image/jpeg;base64," }
];

/* ====== State ====== */
let cart = JSON.parse(localStorage.getItem('ib_cart') || '[]');
let theme = localStorage.getItem('ib_theme') || 'light';

/* ====== Utilities ====== */
function $(sel){ return document.querySelector(sel); }
function $all(sel){ return Array.from(document.querySelectorAll(sel)); }

function saveCart(){
  localStorage.setItem('ib_cart', JSON.stringify(cart));
  renderCartCount();
  renderCartBox();
}

function showToast(msg, time=1600){
  const t = document.getElementById('toast');
  if(!t) return;
  t.textContent = msg;
  t.style.display = 'block';
  setTimeout(()=> t.style.display = 'none', time);
}

/* ====== Theme ====== */
function applyTheme(t){
  document.documentElement.setAttribute('data-theme', t === 'dark' ? 'dark' : '');
  localStorage.setItem('ib_theme', t);
  // update icons (if present)
  $all('#theme-toggle, #theme-toggle-2, #theme-toggle-3').forEach(btn=>{
    if(btn) btn.textContent = (t === 'dark') ? '' : '';
  });
}

/* ====== Render Products (used on products.html) ====== */
function renderProducts(list = products){
  const container = document.getElementById('product-list');
  if(!container) return;
  container.innerHTML = list.map(p => `
    <article class="card" data-id="${p.id}">
      <img src="${p.img}" alt="${p.name}" loading="lazy" />
      <div>
        <h3>${p.name}</h3>
        <div class="price">${p.price}</div>
        <div class="card-actions">
          <button class="btn" onclick="addToCart(${p.id})">Add to Cart</button>
          <button class="btn secondary" onclick="viewDetails(${p.id})">Details</button>
        </div>
      </div>
    </article>
  `).join('');
}

/* ====== Search Handler (products page) ====== */
function attachSearch(){
  const s = document.getElementById('search');
  if(!s) return;
  s.addEventListener('input', (e)=>{
    const q = e.target.value.trim().toLowerCase();
    if(!q) return renderProducts(products);
    const filtered = products.filter(p => p.name.toLowerCase().includes(q));
    renderProducts(filtered);
  });
}

/* ====== Cart functions ====== */
function addToCart(id){
  const p = products.find(x => x.id === id);
  if(!p) return;
  const existing = cart.find(x => x.id === id);
  if(existing) existing.qty++;
  else cart.push({ id: p.id, name: p.name, price: p.price, img: p.img, qty: 1 });
  saveCart();
  showToast(`${p.name} added to cart`);
}

function changeQty(cartIndex, delta){
  if(cartIndex < 0 || cartIndex >= cart.length) return;
  cart[cartIndex].qty += delta;
  if(cart[cartIndex].qty <= 0) cart.splice(cartIndex,1);
  saveCart();
}

function removeItem(cartIndex){
  if(cartIndex < 0 || cartIndex >= cart.length) return;
  cart.splice(cartIndex,1);
  saveCart();
}

function renderCartCount(){
  const counts = cart.reduce((s,i) => s + i.qty, 0);
  $all('#cart-count, #cart-count-2, #cart-count-3').forEach(el => { if(el) el.textContent = counts; });
}

/* Cart popup UI */
function renderCartBox(){
  const box = document.getElementById('cart-box');
  if(!box) return;
  if(cart.length === 0){
    box.innerHTML = `<h4>Your Cart</h4><p style="color:var(--muted)">Cart is empty.</p>`;
    return;
  }
  const itemsHtml = cart.map((c, idx) => `
    <div class="cart-item">
      <img src="${c.img}" alt="${c.name}">
      <div class="meta">
        <strong>${c.name}</strong>
        <div>${c.price} x ${c.qty} = ${c.price * c.qty}</div>
        <div class="qty-controls">
          <button onclick="changeQty(${idx},1)">+</button>
          <button onclick="changeQty(${idx},-1)">-</button>
          <button class="remove-btn" onclick="removeItem(${idx})">Remove</button>
        </div>
      </div>
    </div>
  `).join('');
  const total = cart.reduce((s,i) => s + i.price * i.qty, 0);
  box.innerHTML = `<h4>Your Cart</h4>${itemsHtml}<div style="margin-top:10px;font-weight:700">Total: ${total}</div>
  <div style="display:flex;gap:8px;margin-top:10px">
    <button class="btn" onclick="checkout()">Checkout</button>
    <button class="btn secondary" onclick="clearCart()">Clear</button>
  </div>`;
}

function toggleCartBox(){
  const box = document.getElementById('cart-box');
  if(!box) return;
  box.style.display = box.style.display === 'block' ? 'none' : 'block';
  box.setAttribute('aria-hidden', box.style.display === 'none' ? 'true' : 'false');
}

/* Checkout and helpers */
function checkout(){
  if(cart.length === 0){ showToast('Cart is empty'); return; }
  // For demo: just clear cart and show a message
  const total = cart.reduce((s,i) => s + i.price * i.qty, 0);
  cart = [];
  saveCart();
  showToast(`Order placed  ${total}. (Demo mode)`);
}

/* Clear cart */
function clearCart(){
  cart = [];
  saveCart();
  showToast('Cart cleared');
}

/* simple product details modal (very small) */
function viewDetails(id){
  const p = products.find(x => x.id === id);
  if(!p) return;
  showToast(`${p.name}  ${p.price}`);
}

/* ====== Contact form handler (contact.html) ====== */
function attachContactHandler(){
  const form = document.getElementById('contact-form');
  if(!form) return;
  form.addEventListener('submit', e => {
    e.preventDefault();
    // Demo: show toast and reset
    showToast('Message sent. We will contact you soon.');
    form.reset();
  });
}

/* ====== init on load ====== */
function init(){
  // theme
  applyTheme(theme);

  // attach theme toggle buttons (there are 3 on pages)
  $all('#theme-toggle, #theme-toggle-2, #theme-toggle-3').forEach(btn=>{
    if(!btn) return;
    btn.addEventListener('click', ()=>{
      theme = (localStorage.getItem('ib_theme') === 'dark') ? 'light' : 'dark';
      applyTheme(theme);
    });
  });

  // cart button(s)
  $all('#cart-btn, #cart-btn-2, #cart-btn-3').forEach(b=>{
    if(!b) return;
    b.addEventListener('click', toggleCartBox);
  });

  // product list render if on products page
  if(document.getElementById('product-list')){
    renderProducts(products);
    attachSearch();
  }

  renderCartCount();
  renderCartBox();
  attachContactHandler();

  // keyboard: press 'c' to toggle cart (convenience)
  document.addEventListener('keydown', e=>{
    if(e.key === 'c') toggleCartBox();
  });
}

/* run init */
init();
